  `category` tinyint NOT NULL COMMENT '业务类别：1-线索，2-客户，3-商机，4-合同，5-售后',
  `relation_id` varchar(50) NOT NULL COMMENT '关联业务ID',
  `workspace_id` varchar(50) NOT NULL COMMENT '工作区ID',
  `follow_type` tinyint DEFAULT NULL COMMENT '跟进方式：1-电话，2-邮件，3-微信，4-面访，5-短信，6-QQ，7-其他',
  `title` varchar(200) DEFAULT NULL COMMENT '跟进标题',
  `content` varchar(600) DEFAULT NULL COMMENT '跟进内容',
  `result` tinyint DEFAULT NULL COMMENT '跟进结果：1-成功联系，2-未接通，3-拒绝，4-有兴趣，5-待确认，6-已确认',
  `follow_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '跟进时间',
  `next_follow_time` datetime DEFAULT NULL COMMENT '下次跟进时间',
  `remind_time` datetime DEFAULT NULL COMMENT '提醒时间',
  `follow_user_id` varchar(50) DEFAULT NULL COMMENT '跟进人ID',
  `remark` varchar(300) DEFAULT NULL COMMENT '备注',
  `created_by` varchar(45) DEFAULT NULL COMMENT '创建人',
  `created_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modified_by` varchar(45) DEFAULT NULL COMMENT '修改人',
  `modified_date` datetime DEFAULT NULL COMMENT '修改时间',
  `deleted` varchar(1) DEFAULT 'n' COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='CRM跟进日志记录';
