CREATE TABLE `jbx_lead` (
  `id` varchar(50) NOT NULL DEFAULT '0',
  `lead_code` varchar(50) DEFAULT NULL COMMENT '线索编号',
  `workspace_id` varchar(50) NOT NULL COMMENT '工作区ID',
  `name` varchar(100) NOT NULL COMMENT '联系人姓名',
  `company` varchar(200) DEFAULT NULL COMMENT '公司名称',
  `title` varchar(100) DEFAULT NULL COMMENT '职位',
  `phone` varchar(20) DEFAULT NULL COMMENT '电话',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `wechat` varchar(50) DEFAULT NULL COMMENT '微信号',
  `province` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `source_type` tinyint DEFAULT NULL COMMENT '来源类型：1-网站，2-电话，3-推荐，4-展会，5-广告，6-邮件，7-其他',
  `source_detail` varchar(300) DEFAULT NULL COMMENT '来源详情',
  `industry` int DEFAULT NULL COMMENT '行业',
  `budget` decimal(12,2) DEFAULT NULL COMMENT '预算',
  `follow_up_times` int DEFAULT NULL COMMENT '跟进次数',
  `status` tinyint DEFAULT '1' COMMENT '状态：1-新线索，2-已联系，3-有意向，4-已转商机，5-已流失',
  `quality_score` tinyint DEFAULT NULL COMMENT '质量评分1-5',
  `priority` tinyint DEFAULT '2' COMMENT '优先级：1-低，2-中，3-高',
  `owner_id` varchar(50) DEFAULT NULL COMMENT '负责人ID',
  `assigned_at` datetime DEFAULT NULL COMMENT '分配时间',
  `next_follow_time` datetime DEFAULT NULL COMMENT '下次跟进时间',
  `last_contact_time` datetime DEFAULT NULL COMMENT '最后联系时间',
  `converted_at` datetime DEFAULT NULL COMMENT '转化时间',
  `created_by` varchar(45) DEFAULT NULL COMMENT '创建人',
  `created_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modified_by` varchar(45) DEFAULT NULL COMMENT '修改人',
  `modified_date` datetime DEFAULT NULL COMMENT '修改时间',
  `deleted` varchar(1) DEFAULT 'n' COMMENT '删除标记',
  `demand` text COMMENT '线索需求',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='线索表';
